import React from 'react';

import MainLayout from '../components/layouts/main-layout';

class PageThree extends React.Component {

    render() {
        return (
            <MainLayout>

                <h1>Page # Three!</h1>

            </MainLayout>
        )
    }

}

export default PageThree;
